"use strict";var main={init:function(){jQuery("div#main div.mainMenuSelectOptions").click(function(){var a=jQuery(this).attr("data-id");switch(a){case"quote":if(typeof window.quote!=="undefined"){window.location.href=window.quote}else{window.location.href=window.baseURL+"views/quote/default.php"}break;case"users":if(typeof window.users!=="undefined"){window.location.href=window.users}else{window.location.href=window.baseURL+"views/users/users.php"}break}})},errorID:null,displayErrorMsg:function(a,f,e){var b=this;if(this.errorID){this.errorEl.slideUp("500");clearTimeout(b.errorID);this.errorID=null;this.errorEl=null}var c;var d;if(jQuery("div.modal.show").length>0){c=jQuery("div.modal.show div#error_msg")}else{c=jQuery("div#main-content div#mainErrorMsg div#error_msg")}c.removeClass("alert-success alert-danger alert-info alert-warning");c.empty();c.html(a);c.addClass("alert-"+f);b.errorEl=c;if(e){d=e*1000}else{d=400*a.length}c.slideDown(500);b.errorID=setTimeout(function(){c.slideUp(500)},d)}};